function CreateJailMap()

    local BoneItemId = 4

    local EnterGrate =
    function(map, trigger, entity, x, y, layer)
        Sound.Play("reveal")
        map:RemoveTrigger(57, 6, layer)
        map:RemoveTrigger(58, 6, layer)
        local cutscene =
        {
            SOP.BlackScreen("blackscreen", 0),
            SOP.NoBlock(
                SOP.FadeOutChar("handin", "hero")
            ),
            SOP.RunAction("AddNPC",
               {"handin", { def = "guard", id="guard1", x = 35, y = 20}},
               {GetMapRef}),
            SOP.Wait(2),
            SOP.NoBlock(
                SOP.MoveNPC("gregor", "handin",
                    {
                        "up",
                        "up",
                        "up",
                        "left",
                        "left",
                        "left",
                        "left",
                        "left",
                        "left",
                        "down",
                        "down",
                    })
            ),
            SOP.Wait(1),
            SOP.NoBlock(
                SOP.MoveCamToTile("handin", 43, 15, 3)
            ),
            SOP.MoveNPC("guard1", "handin",
                {
                    "right",
                    "right",
                    "right",
                    "right",
                    "right",
                    "right",
                    "right",
                    "right",
                    "right",
                    "up",
                }),
            SOP.Wait(1),
            SOP.Play("unlock"),
            SOP.NoBlock(
                SOP.WriteTile("handin", {x = 44, y = 18, tile = 134, detail = 120})
            ),
            SOP.WriteTile("handin", {x = 44, y = 17, tile = 134, detail = 104}),
            SOP.NoBlock(
                SOP.MoveNPC("guard1", "handin",
                    {
                        "up",
                        "up",
                        "up",
                        "up",
                        "up",
                        "up",
                    })
            ),
            SOP.Wait(2),
            SOP.Say("handin", "guard1", "Has the black blood gone?", 3),
            SOP.Wait(1),
            SOP.Say("handin", "gregor", "Yeh.", 1),
            SOP.Wait(1),
            SOP.Say("handin", "guard1", "Good.", 1),
            SOP.Wait(0.25),
            SOP.Say("handin", "guard1",
                    "Marmil will want to see you in the tower.", 3.5),
            SOP.Wait(1),
            SOP.Say("handin", "gregor", "Let's go.", 1.5),
            SOP.Wait(1),
            SOP.NoBlock(
                SOP.MoveNPC("gregor", "handin",
                {
                    "down",
                    "down",
                    "down",
                    "down",
                    "down",
                    "down",
                    "down",
                    "down",
                })
            ),
            SOP.NoBlock(
                SOP.MoveNPC("guard1", "handin",
                {
                    "down",
                    "down",
                    "down",
                    "down",
                    "down",
                    "down",
                    "left",
                    "left",
                })
            ),
            SOP.FadeInScreen(),
            SOP.ReplaceScene(
                "handin",
                {
                    map = "sewer",
                    focusX = 35,
                    focusY = 15,
                    hideHero = false
                }),
             SOP.HandOff("sewer")
        }
        local storyboard = Storyboard:Create(gStack, cutscene, true)
        gStack:Push(storyboard)
    end

    local UseGrate =
    function(map, trigger, entity, x, y, layer)
        print('using grate')
        if gWorld:HasKey(BoneItemId) then
            local OnOpen
            local dialogParams =
            {
                textScale = 1,
                choices =
                {
                    options =
                    {
                        "Prize open the grate",
                        "Leave it alone"
                    },
                    OnSelection = function(index)
                        if index == 1 then
                            OnOpen()
                        end
                    end
                },
            }

            gStack:PushFit(gRenderer,
                0, 0,
                "There's a tunnel behind the grate. " ..
                "Prize it open using the bone?",
                300,
                dialogParams)

            OnOpen = function()
                Sound.Play("grate")
                map:WriteTile
                {
                    x = 57,
                    y = 6,
                    layer = layer,
                    tile = 151,
                    collision = false
                }
                map:WriteTile
                {
                    x = 58,
                    y = 6,
                    layer = layer,
                    tile = 152,
                    collision = false
                }


                map:AddTrigger
                {
                    x = 57,
                    y = 6,
                    layer = layer,
                    trigger = "grate_open",
                }
                map:AddTrigger
                {
                    x = 58,
                    y = 6,
                    layer = layer,
                    trigger = "grate_open",
                }
            end
        else
            gStack:PushFit(gRenderer, 0, 0,
                "There's a tunnel behind the grate. " ..
                "But you can't move the grate with your bare hands",
                300,
                {textScale=1})
        end
    end

    local TalkGregor =
    function(map, trigger, entity, x, y, layer)
        local gregor = map.mNPCbyId["gregor"]
        if gregor.mEntity.mTileX == x and
           gregor.mEntity.mTileY == y - 1 then

            gregor.mTalkIndex = gregor.mTalkIndex or 1

            local speech =
            {
                "You're another black blood aren't you?",
                "Come the morning, they'll kill you, just like the others.",
                "If I was you, I'd try and escape.",
                "Pry the drain open, with that big bone you're holding."
            }

            local text = speech[gregor.mTalkIndex]

            local height = 102
            local width = 500
            local x = 0
            local y = -System.ScreenHeight()/2 + height / 2
            gStack:PushFix(gRenderer, x, y, width, height, text,
            {
                textScale = 1,
                title = "Prisoner:"
            })
            gregor.mTalkIndex = gregor.mTalkIndex + 1
            if gregor.mTalkIndex > #speech then
                gregor.mTalkIndex = 1
            end
        end

    end

    local MoveGregor =
    function(map, trigger, entity, x, y, layer)

        if gWorld:HasKey(BoneItemId) then
            local gregor = map.mNPCbyId["gregor"]
            assert(gregor) -- should always exist!
            gregor:FollowPath
            {
                "up",
                "up",
                "up",
                "right",
                "right",
                "right",
                "right",
                "right",
                "right",
                "down",
                "down",
                "down", -- To make him face the correct way
            }
            map:RemoveTrigger(x, y, layer)
        end
    end

    local BoneScript =
    function(map, trigger, entity, x, y, layer)
        local GiveBone = function()
            gStack:PushFit(gRenderer, 0, 0,
                           'Found key item: "Calcified bone"',
                           255,
                           {textScale=1})
            gWorld:AddKey(4)
            Sound.Play("key_item")
        end

        -- 1. The skeleton collapsed into dust
        gStack:PushFit(gRenderer, 0,0, "The skeleton collapsed into dust.",
                       255, {textScale=1, OnFinish=GiveBone})


        Sound.Play("skeleton_destroy")
        map:RemoveTrigger(73, 11, layer)
        map:RemoveTrigger(74, 11, layer)
        map:WriteTile
        {
            x = 74,
            y = 11,
            layer = layer,
            tile = 136,
            collision = true
        }
    end

    local CrumbleScript =
    function(map, trigger, entity, x, y, layer)

        local OnPush
        local dialogParams =
        {
            textScale = 1,
            choices =
            {
                options =
                {
                    "Push the wall",
                    "Leave it alone"
                },
                OnSelection = function(index)
                    if index == 1 then
                        OnPush(map)
                    end
                end
            },
        }

        gStack:PushFit(gRenderer,
                       0, 0,
                       "The wall here is crumbling. Push it?",
                       255,
                       dialogParams)

        -- 2. OnYes erase wall
        OnPush = function(map)
            -- The player's pushing the wall.
            gStack:PushFit(gRenderer, 0,0,
                    "The wall crumbles.",
                    255, {textScale=1})
            Sound.Play("crumble")

            map:RemoveTrigger(x, y, layer)
            map:WriteTile
            {
                x = x,
                y = y,
                layer = layer,
                tile = 134,
                collision = false
            }
        end
    end

